// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { CartProvider } from './context/CartContext';
import { AuthProvider, useAuth } from './context/AuthContext';
import Hero from './components/Hero';
import Clubs from './components/Clubs';
import Rooms from './components/Rooms'; // ← новый компонент
import CombinedLayoutBooking from './components/CombinedLayoutBooking';
import BookingConfirmation from './components/BookingConfirmation';
import AdminPanel from './components/AdminPanel';
import MyBookings from './components/MyBookings';
import Login from './components/Login';
import Cafe from './components/Cafe';
import './styles/App.css';

// Защита маршрутов (как у вас)
const AdminOnlyRoute = () => {
  const { user, loading } = useAuth();
  if (loading) return <div>Загрузка...</div>;
  if (!user || user.role !== 'admin') return <Navigate to="/login" replace />;
  return <AdminPanel />;
};

const UserOnlyRoute = ({ children }) => {
  const { user, loading } = useAuth();
  if (loading) return <div>Загрузка...</div>;
  if (user && user.role === 'admin') return <Navigate to="/admin" replace />;
  if (!user) return <Navigate to="/login" replace />;
  return children;
};

// Главная страница (только Hero + кнопка "Клубы")
const HomePage = () => {
  return (
    <>
      <Hero />
      <Cafe />
    </>
  );
};

// Обёртка для маршрутов приложения
function AppContent() {
  const { user, loading } = useAuth();

  if (loading) {
    return <div className="app-loading">Загрузка...</div>;
  }

  if (user) {
    if (user.role === 'admin') {
      return (
        <Routes>
          <Route path="/admin" element={<AdminPanel />} />
          <Route path="*" element={<Navigate to="/admin" replace />} />
        </Routes>
      );
    } else {
      return (
        <Routes>
          {/* Основные маршруты */}
          <Route path="/" element={<UserOnlyRoute><HomePage /></UserOnlyRoute>} />
          <Route path="/clubs" element={<UserOnlyRoute><Clubs /></UserOnlyRoute>} />
          <Route path="/rooms/:clubAddress" element={<UserOnlyRoute><Rooms /></UserOnlyRoute>} />
          <Route path="/booking/:clubAddress/:room" element={<UserOnlyRoute><CombinedLayoutBooking /></UserOnlyRoute>} />
          <Route path="/confirmation" element={<UserOnlyRoute><BookingConfirmation /></UserOnlyRoute>} />
          <Route path="/my-bookings" element={<UserOnlyRoute><MyBookings /></UserOnlyRoute>} />
          {/* Редиректы */}
          <Route path="/admin" element={<Navigate to="/" replace />} />
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      );
    }
  }

  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="*" element={<Navigate to="/login" replace />} />
    </Routes>
  );
}

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <Router>
          <div className="App">
            <AppContent />
          </div>
        </Router>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
